import Layout from "../components/Layout";

const Services = () => {
  return (
    <Layout>
      <h1>Our Services</h1>
      <div className="services">
        <div className="services-list">
          <div className="item">
            <img src="https://source.unsplash.com/WLUHO9A_xik/1600x900" />
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default Services;
